task.summary:
ajax 提交表单
引入jar包
调用$.ajax,data传入{csrf_token}


        function AjaxSend() {

            $.ajax({
                url: '/post_ajax/',
                type: "POST",
                data: { 'title': 'hello' ,
                csrfmiddlewaretoken: '{{ csrf_token }}'        // 添加这句
            },
                success: function (data) {
                    //处理完成自动调用
                    //data=返回值
                    console.log(data);
                }
            })
        }

